import React from "react";
import Card from "./Card";
import "../styles/CardList.css";

function CardList({ cards }) {
  return (
    <div className="card-list">
      {cards.map((card) => (
        <Card key={card.id} {...card} />
      ))}
    </div>
  );
}

export default CardList;
